const IntroPage = () => {
    return(
    <div>
        <h1>Yeah, quarantine sucks. <span>Big time.</span> But that doesn't mean that joy is cancelled.</h1>
        <Link href="/choice">
        <a>Right?</a>
        </Link>
    </div>
    )
}

export default IntroPage
